/**
 * CRMCleanseAPIApi - axios parameter creator
 */
export const CRMCleanseAPIApiAxiosParamCreator = function (configuration?: Configuration) {
    return {
        /**
         * Check whether particular vin has had a listing after stipulated date or not
         * @summary CRM check of a particular vin
         * @param {string} vin The VIN to identify the car. Must be a valid 17 char VIN
         * @param {string} saleDate sale date to check whether after this listing has appeared or not. Must be 8 character long, with YYYYMMDD format
         * @param {string} [apiKey] The API Authentication Key. Mandatory with all API calls.
         * @param {*} [options] Override http request option.
         * @throws {RequiredError}
         */
        checkCarCrm: async (vin: string, saleDate: string, apiKey?: string, options: RawAxiosRequestConfig = {}): Promise<RequestArgs> => {
            // verify required parameter 'vin' is not null or undefined
            assertParamExists('checkCarCrm', 'vin', vin)
            // verify required parameter 'saleDate' is not null or undefined
            assertParamExists('checkCarCrm', 'saleDate', saleDate)
            const localVarPath = `/crm_check/car/{vin}`
                .replace(`{${"vin"}}`, encodeURIComponent(String(vin)));
            // use dummy base URL string because the URL constructor only accepts absolute URLs.
            const localVarUrlObj = new URL(localVarPath, DUMMY_BASE_URL);
            let baseOptions;
            if (configuration) {
                baseOptions = configuration.baseOptions;
            }

            const localVarRequestOptions = { method: 'GET', ...baseOptions, ...options};
            const localVarHeaderParameter = {} as any;
            const localVarQueryParameter = {} as any;

            // authentication authorizeEndpoint required
            await setApiKeyToObject(localVarQueryParameter, "api_key", configuration)

            // authentication oauth2 required
            // oauth required
            await setOAuthToObject(localVarHeaderParameter, "oauth2", ["read", "write"], configuration)

            // authentication bearerAuth required
            // http bearer authentication required
            await setBearerAuthToObject(localVarHeaderParameter, configuration)

            if (apiKey !== undefined) {
                localVarQueryParameter['api_key'] = apiKey;
            }

            if (saleDate !== undefined) {
                localVarQueryParameter['sale_date'] = saleDate;
            }


    
            setSearchParams(localVarUrlObj, localVarQueryParameter);
            let headersFromBaseOptions = baseOptions && baseOptions.headers ? baseOptions.headers : {};
            localVarRequestOptions.headers = {...localVarHeaderParameter, ...headersFromBaseOptions, ...options.headers};

            return {
                url: toPathString(localVarUrlObj),
                options: localVarRequestOptions,
            };
        },
    }
};

